;s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:1739:"古代一山村，众乡亲抬着供品，载歌载舞欢庆喜雨、敬祭河神热闹的鼓乐声传至深山妖洞。山妖欲寻美女作乐，令狼怪等携狂风黑云去抢。刹时，飞砂走石，草帽、花伞被狂风吹得满天飞舞，河边的乡民惊逃四散。山妖们将姑娘们拦住，众姑娘不从，被山妖用水火珠烧死。为解救众姐妹们脱难，美丽善良的苗香姑娘甘愿一死献身。山妖狂喜，众小妖架苗香飞回山洞。苗香被困山洞，欲求一死未成。山妖摇身变成一美貌小生向苗香逼婚，苗香宁死不从。山妖使出妖法，苗香的家乡顿时洪水泛滥。面对家乡的惨景，苗香只好强忍屈辱。山妖答应改恶从善，苗香信以为真。乡亲们认定苗香已死，为颂其美德而建造香魂庙，日日进香。阴森恐怖的墓地，闪闪磷火随风飘游。山妖率众妖吃人作乐，苗香见山妖本性未改，愤慨万分。她与洞中蚕仙侍娥定计要除掉妖患。惊蛰之夜雷电交加，众山妖惊慌避难。苗香和蚕仙趁机里诮外合盗得山妖的宝物--一颗既能发水、又能纵火的宝珠，将山妖、狼怪等全部杀死。欣喜若狂的苗香、侍娥对视着怔住了。原来，盗宝时，苗香的脸已被烧毁。蚕仙敬慕苗香，舍身相助，它吐尽最后一根丝为苗香织了一幅面锦。苗香回到家乡，途经香魂庙。众乡亲见到她都疑是鬼魂，夺路而逃。苗香痛定而思，自己容貌已毁，又失身山妖，现妖患已除，何必再给大家添惊恐呢。苗香遂举起水火珠自焚。烈火中她化作白衣少女飘然升起，同会侍娥，双双遨游苍穹，迎着美丽的晚霞飞向远方。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:55:"BD$https://eth.ppzuida.com/20171125/8bMsuGba/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i:4;a:80:{s:6:"vod_id";i:20077;s:7:"type_id";i:20;s:9:"type_id_1";i:0;s:8:"group_id";i:0;s:8:"vod_name";s:15:"迷幻美少女";s:7:"vod_sub";s:0:"";s:6:"vod_en";s:15:"mihuanmeishaonv";s:10:"vod_status";i:1;s:10:"vod_letter";s:1:"M";s:9:"vod_color";s:0:"";s:7:"vod_tag";s:0:"";s:9